
# approch is to create two hash map and the key will be the letter and value will be the count 
# and check the two hash map is ==
# this is the worst case having O(n2) this is because there are two nested loops iterating over the range of size
# time complexity and space complexity is O(n) where n is the length of the input strings

def isAnagram(s: str, t: str) -> bool:
    if len(s) != len(t):
        return False
    size = len(s)
    s_hash = {}
    t_hash = {}
    for i in range(0,size):
        s_hash[s[i]] = 0
        for j in range(0,size):
            if s[i] == s[j]:
                a = s_hash[s[i]]
                s_hash[s[i]] = a+1
    for i in range(0,size):
        t_hash[t[i]] = 0
        for j in range(0,size):
            if t[i] == t[j]:
                a = t_hash[t[i]]
                t_hash[t[i]] = a+1
                
    if s_hash == t_hash:
        return True
    return False
    
    
