# here the time complexity is O(n)  the code iterates over the characters of the strings once
# the space complexity is also O(n) in the worst case

def isAnagram2(s: str, t: str) -> bool:
    if len(s) != len(t):
        return False
    size = len(s)
    s_hash, t_hash = {}, {}
    for i in range(0,size):
        s_hash[s[i]] = 1 + s_hash.get(s[i], 0)
        t_hash[t[i]] = 1 + t_hash.get(t[i], 0)
        
                
    if s_hash == t_hash:
        return True
    return False

